message:
POSIÇÃO ELEITORAL DA DIREÇÃO DA ADESG.

Diante do momento eleitoral, cabe a Associação dos Diplomados da Escola Superior de Guerra (ADESG) se posicionar, informando o seu propósito dentro daquilo que se promulga para o bem da nação.

A sua missão é congregar os diplomados da Escola Superior de Guerra (ESG) e vivificar a solidariedade de seus integrantes. Ela existe para divulgar a Doutrina da ESG, e para atender aos diplomados da ESG e aos diplomados em seus Ciclos de Estudos ministrados nas delegacias e representações.

A ADESG atua sem vinculações com partidos políticos, entidades, grupos, associações ou organizações de qualquer natureza.

Todavia, por tratar dos assuntos nacionais e internacionais, sem esquecer os valores construtores do civismo e do nacionalismo, que enaltecem o caráter da pessoa humana, principalmente os que exaltam a brasilidade, não pode ficar alheia ao embate eleitoral e, pior, em cima do muro.

Desta forma, perante uma disputa acirrada, sugere que seus associados optem pela candidatura cuja pauta contemple os seguintes posicionamentos:

·         Contra a corrupção;

·         Repúdio à ideologia de gênero;

·         Combate à perseguição religiosa;

·         Objeção à regulação da mídia;

·         Refutação à criminalidade;

·         Contraposição à legalização das drogas;

·         Reprovação à invasão de propriedades;

·         Manutenção da estrutura famíliar;

·         Objeção à doutrinação nas escolas; e

·         Opor-se à impunidade.

 

Esta presidência, ao opinar nesta linha, tem respaldo de seus delegados. Fica, também, à vontade em fazê-lo, uma vez que, no passado, quando o sistema ESG/ADESG foi ameaçado por possíveis ações esdrúxulas que atemorizavam o bom andamento da instituição, houve manifestações de alguns de seus presidentes, quais sejam:

·         1955 – Engenheiro GLAYCON DE PAIVA - Crise Política – transformação da ESG em uma Escola somente para militares;

·         1998/1999 – Brigadeiro ÊNIO RUSSO – Salvaguarda da posição da ESG dentro da estrutura do Ministério da Defesa, com a manutenção da existência da ADESG;

·         2000/2001 – Médico MOACIR ELIAS - Preservação da ESG no Rio de Janeiro, com a continuidade do funcionamento da ADESG;

·         2004/2005– Advogado AMÉRICO BARBOSA DE PAULA – Criação da Comissão Revisora da ESG (CRESG), visando a não extinção da ESG e a volta do comandante da Escola  ser do posto de oficial general de quatro estrelas.

 

Esses fatos do passado e o quadro político atual, com possíveis consequências imprevisíveis para a vida nacional, solicita-se prudência e sabedoria na escolha do futuro mandatário do País.

 

Atenciosamente,

Antonio Celente Videira.

Presidente da ADESG.
